import React, { useState } from "react";

const DoctorShare = () => {
  const [searchFilters, setSearchFilters] = useState({
    billNo: "",
    mrNo: "",
    patientName: "",
    fromDate: "",
    toDate: "",
  });

  const [pageSize, setPageSize] = useState(5);
  const [currentPage, setCurrentPage] = useState(1);

  const mockData = [
    {
      id: 1,
      mrNo: 1701,
      tariffName: "MJPJAY",
      sponsorName: "Medify CMP",
      billDate: "Jan 2, 2024",
      discount: 0,
      netAmount: 100,
      patientName: "Mrs. Ningamma Aralikatti",
      govNo: "Gov/2025/000194",
      billNo: "Gov/2025/01/02/0000139",
      billAmount: 600,
    },
  ];
 
  const tableData = mockData.slice(
    (currentPage - 1) * pageSize,
    currentPage * pageSize
  );

  const handleFilterChange = (key, value) => {
    setSearchFilters({ ...searchFilters, [key]: value });
  };

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  const handlePageSizeChange = (size) => {
    setPageSize(Number(size));
    setCurrentPage(1);
  };

  return (
    <div style={{ padding: "20px" }}>
      <h6 style={{ backgroundColor: "#34B3F1", padding: "10px", borderRadius: "5px" }}>
        Doctor Share
      </h6>

      <div style={{ display: "flex", gap: "10px", padding: "10px", borderRadius: "5px" }}>
        {Object.keys(searchFilters).map((key) => (
          <input
            key={key}
            type={key.includes("Date") ? "date" : "text"}
            placeholder={key.replace(/([A-Z])/g, " $1").trim()}
            value={searchFilters[key]}
            onChange={(e) => handleFilterChange(key, e.target.value)}
          />
        ))}
        <button style={{ backgroundColor: "#007bff", color: "#fff" }}>Search Key</button>
        <button style={{ backgroundColor: "#ff4d4d", color: "#fff" }}>Reset</button>
      </div>

      <table style={{ width: "100%", marginTop: "20px", borderCollapse: "collapse" }}>
        <thead>
          <tr style={{ backgroundColor: "#f2f2f2" }}>
            {["Sr No.", "Action", "Mr No.", "Tariff Name", "Sponsor Name", "Bill Date", "Discount", "Net Amount", "Patient Name", "Gov No.", "Bill No.", "Bill Amount", "Freeze/Unfreeze"].map((header) => (
              <th key={header}>{header}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, index) => (
            <tr key={row.id}>
              <td>{(currentPage - 1) * pageSize + index + 1}</td>
              <td>
                <button style={{ backgroundColor: "#007bff", color: "#fff", border: "none", borderRadius: "4px", padding: "4px 8px" }}>Edit</button>
              </td>
              {Object.keys(row).slice(1).map((key) => (
                <td key={key}>{row[key]}</td>
              ))}
              <td>
                <input type="checkbox" />
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginTop: "20px" }}>
        <select value={pageSize} onChange={(e) => handlePageSizeChange(e.target.value)}>
          {[5, 10, 15, 20].map((size) => (
            <option key={size} value={size}>{size}</option>
          ))}
        </select>
        <div>
          {[...Array(Math.ceil(mockData.length / pageSize)).keys()].map((page) => (
            <button
              key={page}
              onClick={() => handlePageChange(page + 1)}
              style={{
                margin: "0 5px",
                padding: "5px 10px",
                backgroundColor: currentPage === page + 1 ? "#007bff" : "#fff",
                color: currentPage === page + 1 ? "#fff" : "#000",
                border: "1px solid #ccc",
                borderRadius: "3px",
              }}
            >
              {page + 1}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
};

export default DoctorShare;
